import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const rootElement = document.getElementById('root');
if (!rootElement) {
  throw new Error("Could not find root element to mount to");
}

const root = ReactDOM.createRoot(rootElement);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

export enum Screen {
  HOME = 'HOME',
  LESSON = 'LESSON',
  PET_OASIS = 'PET_OASIS'
}

export interface Post {
  id: string;
  author: string;
  handle: string;
  avatar: string;
  image?: string;
  content?: string;
  type: 'organic' | 'suggested' | 'sponsored';
  title?: string;
  views?: string;
  isFollowing?: boolean;
}

import React, { useState } from 'react';
import HomeView from './components/HomeView';
import LessonView from './components/LessonView';
import PetOasisView from './components/PetOasisView';
import { Screen } from './types';

const App: React.FC = () => {
  const [currentScreen, setCurrentScreen] = useState<Screen>(Screen.HOME);

  const renderScreen = () => {
    switch (currentScreen) {
      case Screen.HOME:
        return <HomeView onNavigate={setCurrentScreen} />;
      case Screen.LESSON:
        return <LessonView onNavigate={setCurrentScreen} />;
      case Screen.PET_OASIS:
        return <PetOasisView onNavigate={setCurrentScreen} />;
      default:
        return <HomeView onNavigate={setCurrentScreen} />;
    }
  };

  return (
    <div className="app-container">
      {renderScreen()}
    </div>
  );
};

export default App;

